import React, { useState, useRef } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

export default function PlayerRegister() {
  const [form, setForm] = useState({
    full_name: "",
    dob: "",
    gender: "",
    father_name: "",
    mother_name: "",
    guardian_phone: "",
    guardian_email: "",
    address: "",
    photo: null,
    birthCertificate: null,
  });
  const [certificateFile, setCertificateFile] = useState(null);
  const [ocrLoading, setOcrLoading] = useState(false);
  const [err, setErr] = useState("");
  const [success, setSuccess] = useState("");
  const certificateInputRef = useRef();
  const navigate = useNavigate();

  // Text or file input changes
  const handleChange = (e) => {
    const { name, value, files } = e.target;
    setForm((prev) => ({
      ...prev,
      [name]: files ? files[0] : value,
    }));
    // Keep the selected certificate for OCR
    if (name === "birthCertificate" && files && files[0]) {
      setCertificateFile(files[0]);
    }
  };

  // OCR extraction using GPT-4o endpoint
  const handleOCR = async () => {
    setErr(""); setSuccess(""); setOcrLoading(true);
    try {
      if (!certificateFile) {
        setErr("Please upload a birth certificate image first.");
        setOcrLoading(false);
        return;
      }
      const token = localStorage.getItem("token");
      const formData = new FormData();
      formData.append("certificate", certificateFile);
      const res = await axios.post(
        `${process.env.REACT_APP_API_URL || "http://localhost:5000/api/ocr"}`,
        formData,
        { headers: { Authorization: `Bearer ${token}` } }
      );
      // Autofill fields from returned data
      if (res.data.data) {
        setForm((prev) => ({
          ...prev,
          ...res.data.data,
          dob: res.data.data.dob_ad || "",
        }));
        setSuccess("Data auto-filled from certificate!");
      } else {
        setErr("Could not extract data from certificate.");
      }
    } catch (error) {
      setErr(error?.response?.data?.message || "OCR extraction failed.");
    }
    setOcrLoading(false);
  };

  // Registration form submit
  const handleSubmit = async (e) => {
    e.preventDefault();
    setErr(""); setSuccess("");
    try {
      const token = localStorage.getItem("token");
      const formData = new FormData();
      Object.entries(form).forEach(([k, v]) => {
        if (v) formData.append(k, v);
      });
      await axios.post(
        `${process.env.REACT_APP_API_URL || "http://localhost:5000/api/players/register"}`,
        formData,
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setSuccess("Player registered!");
      setTimeout(() => navigate("/player-list"), 1500);
    } catch (error) {
      setErr(error?.response?.data?.message || "Registration failed");
    }
  };

  return (
    <div className="max-w-xl mx-auto mt-8 bg-white p-6 rounded shadow">
      <h2 className="text-2xl font-bold mb-4">Register New Player</h2>
      <form onSubmit={handleSubmit}>
        <input className="w-full border p-2 mb-2" name="full_name" placeholder="Full Name" value={form.full_name} onChange={handleChange} required />
        <input className="w-full border p-2 mb-2" name="dob" type="date" placeholder="Date of Birth" value={form.dob} onChange={handleChange} required />
        <select className="w-full border p-2 mb-2" name="gender" value={form.gender} onChange={handleChange} required>
          <option value="">Gender</option>
          <option value="male">Male</option>
          <option value="female">Female</option>
          <option value="other">Other</option>
        </select>
        <input className="w-full border p-2 mb-2" name="father_name" placeholder="Father's Name" value={form.father_name} onChange={handleChange} required />
        <input className="w-full border p-2 mb-2" name="mother_name" placeholder="Mother's Name" value={form.mother_name} onChange={handleChange} />
        <input className="w-full border p-2 mb-2" name="guardian_phone" placeholder="Guardian Phone" value={form.guardian_phone} onChange={handleChange} required />
        <input className="w-full border p-2 mb-2" name="guardian_email" placeholder="Guardian Email" value={form.guardian_email} onChange={handleChange} />
        <input className="w-full border p-2 mb-2" name="address" placeholder="Address" value={form.address} onChange={handleChange} />

        <div className="mb-2">
          <label>Photo: </label>
          <input type="file" name="photo" accept="image/*" onChange={handleChange} />
        </div>
        <div className="mb-2 flex items-center gap-2">
          <label>Birth Certificate: </label>
          <input
            type="file"
            name="birthCertificate"
            accept="image/*,.pdf"
            ref={certificateInputRef}
            onChange={handleChange}
          />
          <button
            type="button"
            onClick={handleOCR}
            className="py-1 px-3 bg-blue-500 text-white rounded"
            disabled={ocrLoading}
          >
            {ocrLoading ? "Extracting..." : "Extract From Certificate"}
          </button>
        </div>
        {err && <div className="text-red-500 mb-2">{err}</div>}
        {success && <div className="text-green-600 mb-2">{success}</div>}
        <button type="submit" className="w-full py-2 bg-green-600 text-white rounded">Register Player</button>
      </form>
    </div>
  );
}
